import React from 'react';
import MenuIcon from '@material-ui/icons/Menu';
import { AppBar, Toolbar, Button, IconButton, Typography, createMuiTheme, Box, InputBase } from '@material-ui/core';
import {makeStyles} from '@material-ui/core/styles';
import SearchIcon from '@material-ui/icons/Search';

const useStyles = makeStyles((theme) => ({
    root: {
        backgroundColor: "#20B2AA",
        flexGrow: 1,
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },
  }));

const Header = () => {
    const classes = useStyles();
    return(
        <div className={classes.root}>
            <AppBar className={classes.Header} position='static'>
                <Toolbar>
                    <IconButton edge='start'>
                        <MenuIcon/>
                    </IconButton>
                    <Box ml={3} mr={4}>
                        <Typography variant='h6'> MyCookBook </Typography>
                    </Box>
                    <Typography edge='end'>
                        <Box bgcolor="#fff" boxShadow={5} mr={0} borderRadius='borderRadius' py={0} pr={10}>
                            <IconButton>
                                <SearchIcon/>
                            </IconButton>
                            <InputBase placeholder='Search...'/>
                        </Box>
                    </Typography>
                </Toolbar>
            </AppBar>
        </div>
    )
}

export default Header;
